import http from './base-api-service';

const list = (filter) => {
    const options = {}

    if(filter) {
        options.params
    }

    http.get('/pets', {params: filter})
};

const detail = (id) => http.get(`/pets/${id}`);

const service = {
    list,
    detail
}

export default service;
